import React,{useState} from 'react';
import './Galerie.css'

import Img1 from '../public/images/Povestea SF foto site/10.jpg'


const Poze = () =>{

    let data =[
        {
            id:1,
            imgSrc:'/images/Povestea SF foto site/10.jpg',
        },
        {
            id:2,
            imgSrc:'/images/Povestea SF foto site/11.jpg',
        },
        {
            id:3,
            imgSrc:'/images/Povestea SF foto site/118188958_3506456106054639_6530225995219771555_n.jpg',
        },
        {
            id:4,
            imgSrc:'/images/Povestea SF foto site/12.jpg',
        },
        {
            id:5,
            imgSrc:'/images/Povestea SF foto site/13.jpg',
        },
        {
            id:6,
            imgSrc:'/images/Povestea SF foto site/18.jpg',
        },
        {
            id:7,
            imgSrc:'/images/Povestea SF foto site/19.jpg',
        },
        {
            id:8,
            imgSrc:'/images/Povestea SF foto site/2.jpg',
        },
        {
            id:9,
            imgSrc:'/images/Povestea SF foto site/20.jpg',
        },
        {
            id:10,
            imgSrc:'/images/Povestea SF foto site/21.jpg',
        }
    ]
    const[model, setModel] = useState(false);
    const [tempingSrc, setTempingSrc]= useState('');
    const getImg = (imgSrc) =>{
    setTempingSrc(imgSrc);
    setModel(true);
}
    return(
        <>
        <div className={model? "model open": "model"}>
            <img src={tempingSrc} />
        </div>
        <div className="galerie">
            {data.map((item,index)=>{
                return(
                    <div className="poze" key="index" onClick={()=> getImg(item.imgSrc)}>
                        <img src={item.imgSrc} style={{width : '100%'}}/>

                    </div>
                )
            })}

        </div>
        </>
    )
}
export default Poze;
